const Products = () => {
    return (
        <div>
            <img src="/img1.png" />
            <h1>Star Wars Home Arcade Game</h1>
            <h3>Rp. 6749865</h3>
            <p>This gergeous, three-quarter-sized arcade cabinet comes loaded with some </p>
            <p>classic Star Wars gaming titles, including A New Hope, The Empire Strikes</p>
            <p>Back, and Return of the Jedi</p>
            <button>Add To Wishlist</button>
            <button>View</button>
            <button>Add To Cart</button>
        </div>
    )
}

export default Products;
